import './Tile.css';

export default function Tile({number, image}) {
    if(number % 2 === 0) {
        return(
        <div className='black-tile'>
            <img src="assets/images/b_pawn.png" alt="ImageCouldntLoad"/>
        </div>
        );
    } else {
        return(
        <div className='white-tile'>
            <img src={image} alt="ImageCouldntLoad"/>
        </div>
        );   
    }
}
